                    padding-right: 0.5rem;
                    font-size: 1.0rem;
                }
                margin: 0rem;
                cursor: pointer;
                &::before {
                    content: "";
                    display: block;
                    position: absolute;
                    height: 0em;
                    left: 0;
                    right: 0;
                    bottom: 0px;
                    color: $color2;
