                word-wrap: break-word;
                position: absolute;
                bottom: 1px;
                outline: none;
                color: $color6;
                border: 0;
                padding: 0.6em;
                box-shadow: 2px 2px 6px #888888;
                margin-bottom: 1.0rem;
                width: 80%;
                font-size: 1rem;
                height: 100% 3rem;
                max-height: 7rem;
                padding-left: 1rem;
                border-radius: 1.5rem;
                background-color: rgb(177, 165, 165);
            }
        }
        .qr {
            width: 10rem;
            @include breakpoint-up(medium) {
                width: 250px;
                height: 100%;
            }
        }
        .dim {
            color: $color5;
            margin-right: auto;
            padding-top: 0.1rem;
            @include breakpoint-down(small) {
                padding-left: 1rem;
            }
            font-size: 1.8rem;
            button {
                width: 4rem;
                height: 1.5rem;
                background-color: $color5;
                color: $color3;
            }
        }
    }
}
